import { Link } from "react-router-dom";


function Navbar(){
    return (
        <div className="">
      <Link to="/">Home</Link> 
      <Link to="/about">About</Link>      
      <Link to="/product">Product</Link>           
        </div>
    )
}



export default Navbar
